import axios from 'axios'
import './Threads.css';
import { Link } from 'react-router-dom';


export function Threads(){
axios.get("https://virtserver.swaggerhub.com/INFO_3/BulletinBoardApplication/1.0.0/threads?offset=1")
.then((response) => {
    console.log(response.data)
})
.catch((error)=>console.log(error))

function createThread(){
    axios.post("https://virtserver.swaggerhub.com/INFO_3/BulletinBoardApplication/1.0.0/threads",{
        "threadId":"one",
        "title":"初めてのスレッド"
    }).then((res)=>console.log(res))
}



return(
    <div className='Content'>
    <h2>スレッド新規作成</h2>
    <form>
        <input type='text' placeholder='スレッド名'/>
    </form>
    <div className='Flex'>
    <Link to="/">Topに戻る</Link>
    <button type='button' onClick={()=>createThread}>作成</button>
    </div>
    </div>
)

}

export default Threads;
